import { HeaderDetails } from "./types";

export const headerDetailSwitch = (lastPath: string, questionCount: number): HeaderDetails => {
    if (lastPath === "Station")
        return {
            title: "Brief",
            percentage: 5,
            briefAndExit: false,
            timer: false,
            pathToNext: "/OSCE/Station/0",
            pathToPrev: "/OSCE",
        };
    else if (Number.isInteger(Number(lastPath))) {
        const i = Number(lastPath);
        const percentage = 10 + (100 * i) / questionCount;
        return {
            title: "Station One",
            percentage,
            briefAndExit: true,
            timer: true,
            pathToNext: "/OSCE/Station/" + (i === questionCount - 1 ? "Summary" : i + 1),
            pathToPrev: "/OSCE/Station/" + (i === 0 ? i : i - 1),
        };
    } else if (lastPath === "Summary")
        return {
            title: "Finish",
            percentage: 100,
            briefAndExit: true,
            timer: false,
            pathToNext: "/OSCE/Station/Review0",
            pathToPrev: "/OSCE",
        };
    else if (lastPath.startsWith("Review")) {
        const i = Number(lastPath.substring(lastPath.indexOf("w") + 1));
        const percentage = 10 + (100 * i) / questionCount;
        return {
            title: "Review",
            percentage,
            briefAndExit: true,
            timer: false,
            pathToNext:
                "/OSCE/Station/" + (i === questionCount - 1 ? "MarkReview" : "Review" + i + 1),
            pathToPrev: "/OSCE/Station/" + (i === 0 ? "Summary" : "Review" + (i - 1)),
        };
    } else
        return {
            title: "Summary",
            percentage: 100,
            briefAndExit: true,
            timer: false,
            pathToNext: "/OSCE",
            pathToPrev: "",
        };
};
